import React from 'react';
import '../styles/Detail.scss';

function Detail(){
    return(
        <div>
            <div className="detail-inner">
                <div className="go-back">
                    <img className="back" alt="back" src="imgs/back.png" />
                    글 목록으로
                </div>
            </div>
        </div>
    )
}
export default Detail;
